import React, { useState } from 'react'
import './Navigation.css'
import { makeStyles } from '@material-ui/core/styles';
import { Container, Row, Col } from 'react-bootstrap'
import { Typography, TextField } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    root: {
        '& > *': {
            color: "white",
            borderColor: "white !important"
        },
        '& label.Mui-focused': {
            color: 'white',
        },
        '& .MuiInput-underline:before': {
            borderBottomColor: 'white',
        },
        '&:hover .MuiInput-underline:before': {
            borderBottomColor: 'white',
        },
        '& .MuiInput-underline:hover': {
            borderBottomColor: 'white',
        },
        '& .MuiInput-underline:after': {
            borderBottomColor: 'yellow',
        },
        '& .MuiOutlinedInput-root': {
            '& fieldset': {
                borderColor: 'white',
            },
            '&:hover fieldset': {
                borderColor: 'whitw',
            },
            '&.Mui-focused fieldset': {
                borderColor: 'yellow',
            },
        },
    },
}));

function Navigation() {
    const classes = useStyles();

    const [search, setSearch] = useState();

    return (
        <Container fluid className="navigation">
            <Row>
                <Col md={3} className="section-1">
                    <Row>
                        <Col md={3}>
                            <div className="eclipse-1">
                                <Typography variant="h3" className="abrev">K</Typography>
                                <div className="eclipse-2"></div>
                                <div className="eclipse-3"></div>
                            </div>
                        </Col>
                        <Col md={9}>
                            <Typography variant="h5" className="companyName">KARANGA</Typography>
                            <Typography className="products">FOOD & GROCERY</Typography>
                        </Col>
                    </Row>
                </Col>

                <Col md={6} className="section-2">
                    <TextField
                        className={classes.root}
                        margin='normal'
                        required
                        fullWidth
                        id='search'
                        label='Search'
                        name='search'
                        type='text'
                        value={search}
                        onChange={(e) => setProfession(e.target.value)}
                    />
                </Col>

                <Col md={3} className="section-3"></Col>
            </Row>
        </Container>

    )
}

export default Navigation
